// Global import css / js
import 'aos/dist/aos.css';
import '../styles/app.scss';

import AppLayout from '~/src/layouts/AppLayout';

function MyApp({ Component, pageProps }) {

    return (
        <AppLayout>
            <Component {...pageProps} />
        </AppLayout>
    );
}

export default MyApp;
